eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   translations: () => (/* binding */ translations)\n/* harmony export */ });\nconst translations = {\n    fi: {\n        // Header\n        tryForFree: \"Kokeile ilmaiseksi\",\n        // Hero\n        betterWayToLearn: \"Tehokasta tukea harjoitteluun.\",\n        heroDescription: \"Lexie auttaa sinua harjoittelemaan kokeisiin tai tekem\\xe4\\xe4n kotiteht\\xe4vi\\xe4. Se tekee opiskeltavista asioista muistikortteja ja teht\\xe4vi\\xe4, joiden avulla voit harjoitella keskeisi\\xe4 k\\xe4sitteit\\xe4 tai testata osaamistasi. \",\n        tryFreeButton: \"Kokeile ilmaiseksi\",\n        // Features\n        takePicture: \"Ota kuva. Lexie hoitaa loput.\",\n        featuresIngress: \"Skannaa mit\\xe4 tahansa teksti\\xe4, ja muuta se harjoittelumateriaaliksi.\",\n        adaptiveText: \"Aina saatavilla oleva apu\",\n        adaptiveTextDesc: \"Ota kuva kotiteht\\xe4v\\xe4st\\xe4si ja saat apua saman tien. Lexie ei anna valmiita vastauksia vaan ohjaa sinut oivaltamaan itse.\",\n        effectiveWay: \"Tehokas tapa oppia keskeisi\\xe4 k\\xe4sitteit\\xe4\",\n        effectiveWayDesc: \"Muistikortit pilkkovat laajat kokonaisuudet helposti opittaviin osiin. Kertaamalla korttien avulla opit t\\xe4rkeit\\xe4 k\\xe4sitteit\\xe4.\",\n        testYourKnowledge: \"Harjoitusteht\\xe4vien avulla voit kerrata ja testata osaamistasi\",\n        testYourKnowledgeDesc: \"Monipuoliset teht\\xe4v\\xe4t auttavat kertaamaan opittua. N\\xe4et heti mitk\\xe4 asiat osaat jo hyvin, ja mitk\\xe4 vaativat viel\\xe4 harjoittelua.\",\n        // Benefits\n        supportingEveryChild: \"Tukena jokaisen lapsen oppimisessa\",\n        personalLearningSupport: \"Tukea silloin kun sit\\xe4 tarvitset\",\n        personalLearningDesc: \"Lexie auttaa oppimaan silloinkin, kun kukaan muu ei ehdi tai osaa neuvoa. Saat harjoitella omassa tahdissasi.\",\n        enhanceLearning: \"Helpottaa kokeisiin valmistautumista\",\n        enhanceLearningDesc: \"Lexie auttaa ymm\\xe4rt\\xe4m\\xe4\\xe4n opeteltavat asiat ja kertaamaan niit\\xe4 tehokkaasti.\",\n        learnAnywhere: \"Materiaalit kulkevat mukanasi\",\n        learnAnywhereDesc: \"Ota kuva kerran, harjoittele miss\\xe4 ja milloin tahansa. Harjoittelumateriaalit kulkevat aina taskussasi.\",\n        learnInYourLanguage: \"Opiskele omalla kielell\\xe4si\",\n        learnInYourLanguageDesc: \"K\\xe4\\xe4nn\\xe4 sanat ja selitykset sille kielelle, jota ymm\\xe4rr\\xe4t parhaiten.\",\n        buildConfidence: \"Opiskele itsen\\xe4isesti omaan tahtiin\",\n        buildConfidenceDesc: \"Harjoittele juuri silloin ja siten kuin sinulle parhaiten sopii.\",\n        adaptiveLearning: \"Mukautuu sinun tapaasi oppia\",\n        adaptiveLearningDesc: \"Lue, kuuntele tai muuta tekstin ulkoasua. Valitse juuri sinulle sopiva tapa opiskella.\",\n        // FAQ\n        faq: \"Usein kysytty\\xe4\",\n        howLexieWorks: \"Miten Lexie toimii?\",\n        howLexieWorksAnswer: \"Lexie tunnistaa opiskelumateriaalisi kuvasta. Kun otat valokuvan, teknologiamme lukee tekstin, analysoi sis\\xe4ll\\xf6n rakenteen ja tunnistaa, millainen oppimismateriaali on kyseess\\xe4.\\n\\nJ\\xe4rjestelm\\xe4 pilkkoo sis\\xe4ll\\xf6n keskeisiin k\\xe4sitteisiin ja niiden v\\xe4lisiin suhteisiin. Sanastoista se poimii termit ja m\\xe4\\xe4ritelm\\xe4t. Historiasta se tunnistaa tapahtumat ja p\\xe4iv\\xe4m\\xe4\\xe4r\\xe4t. Luonnontieteist\\xe4 se erottaa k\\xe4sitteet ja selitykset.\\n\\nT\\xe4m\\xe4 k\\xe4sitelty tieto muunnetaan erilaisiksi harjoitusmuodoiksi:\\n\\n• Kyselyiksi, jotka testaavat ymm\\xe4rt\\xe4mist\\xe4 eri tasoilla\\n• Muistikorteiksi nopeaa kertausta varten\\n• \\xc4\\xe4nitiedostoiksi oikeaa \\xe4\\xe4nt\\xe4mist\\xe4 varten\\n• Yhteenvedoiksi, jotka korostavat p\\xe4\\xe4kohtia\\n\\nKoko prosessi kest\\xe4\\xe4 vain sekunteja. Sinun ei tarvitse kirjoittaa tai muotoilla sis\\xe4lt\\xf6\\xe4 itse.\",\n        whatCanLearn: \"Mitk\\xe4 oppiaineet toimivat parhaiten Lexien kanssa?\",\n        whatCanLearnAnswer: \"Lexie toimii parhaiten \\xe4idinkielen, yhteiskuntatieteiden, luonnontieteiden ja vieraiden kielten opiskelussa - eli oppiaineissa, joissa k\\xe4ytet\\xe4\\xe4n tekstipohjaisia materiaaleja.\\n\\nT\\xe4ll\\xe4 hetkell\\xe4 Lexie ei viel\\xe4 k\\xe4sittele hyvin matemaattisia yht\\xe4l\\xf6it\\xe4 ja kaavoja, vaikka se tunnistaakin matemaattisia k\\xe4sitteit\\xe4. Ty\\xf6skentelemme t\\xe4m\\xe4n parantamiseksi.\\n\\nMy\\xf6s vahvasti visuaaliset aineet kuten taide tai musiikkiteoria erityismerkint\\xf6ineen eiv\\xe4t v\\xe4ltt\\xe4m\\xe4tt\\xe4 toimi parhaalla mahdollisella tavalla. Selke\\xe4sti j\\xe4sennellyt tekstimateriaalit toimivat parhaiten.\",\n        whyDifferent: \"Miksi LexieLearn on erilainen kuin muut oppimissovellukset?\",\n        whyDifferentAnswer: \"Useimmat oppimissovellukset tarjoavat valmiita sis\\xe4lt\\xf6j\\xe4 tietyille oppiaineille. Lexie sen sijaan toimii suoraan lapsen omien koulumateriaalien kanssa.\\n\\nMuut sovellukset vaativat, ett\\xe4 sis\\xe4lt\\xf6 sy\\xf6tet\\xe4\\xe4n k\\xe4sin tai ne rajoittuvat tiettyihin aiheisiin. Lexie k\\xe4sittelee automaattisesti mit\\xe4 tahansa oppiainetta, eik\\xe4 lapsen tarvitse kirjoittaa mit\\xe4\\xe4n itse.\\n\\nKun muistikorttisovellukset vaativat jokaisen termin ja m\\xe4\\xe4ritelm\\xe4n kirjoittamista erikseen, Lexie poimii n\\xe4m\\xe4 tiedot automaattisesti lapsen materiaaleista.\\n\\nN\\xe4in Lexie tekee olemassa olevista kotiteht\\xe4vist\\xe4 tehokkaampia.\",\n        howToUse: \"Millaisia oppimismenetelmi\\xe4 Lexie k\\xe4ytt\\xe4\\xe4?\",\n        howToUseAnswer: \"Lexie perustuu n\\xe4ytt\\xf6\\xf6n pohjautuviin oppimismenetelmiin:\\n\\n• Aktiivinen muistaminen muistikorttien avulla tehostaa oppimista pelkk\\xe4\\xe4n lukemiseen verrattuna\\n• Ajoitettu kertaus auttaa painamaan asiat pitk\\xe4kestoiseen muistiin\\n• Ymm\\xe4rt\\xe4misen seuranta n\\xe4ytt\\xe4\\xe4, mitk\\xe4 asiat osaat ja mitk\\xe4 vaativat lis\\xe4\\xe4 harjoittelua\\n• Monipuolinen oppiminen tekstin, \\xe4\\xe4nen ja interaktiivisten harjoitusten avulla\\n\\nKysymysten avulla Lexie ohjaa sinua ymm\\xe4rt\\xe4m\\xe4\\xe4n asioita syv\\xe4llisemmin pelkkien vastausten antamisen sijaan. T\\xe4m\\xe4 kehitt\\xe4\\xe4 kriittist\\xe4 ajattelua samalla kun opit uutta sis\\xe4lt\\xf6\\xe4.\",\n        materialsStored: \"Ovatko tietoni turvassa Lexiess\\xe4?\",\n        materialsStoredAnswer: \"Kyll\\xe4. Emme s\\xe4ilyt\\xe4 ottamiasi alkuper\\xe4isi\\xe4 kuvia k\\xe4sittelyvaihetta pidemp\\xe4\\xe4n. Luodut oppimateriaalit tallennetaan vain laitteellesi ja henkil\\xf6kohtaiselle tilillesi.\\n\\nEmme jaa sis\\xe4lt\\xf6\\xe4si muille k\\xe4ytt\\xe4jille tai kolmansille osapuolille. Emme k\\xe4yt\\xe4 materiaalejasi j\\xe4rjestelmiemme kouluttamiseen. Lapsesi opiskelutiedot pysyv\\xe4t yksityisin\\xe4.\\n\\nSovellus tarvitsee kameran k\\xe4ytt\\xf6oikeuden vain opiskelumateriaalien kuvaamiseen. Emme k\\xe4yt\\xe4 muita laitteellasi olevia kuvia.\",\n        howDesignedForKids: \"Miten lapset on huomioitu Lexien suunnittelussa?\",\n        howDesignedForKidsAnswer: \"Suunnittelimme Lexien erityisesti lapsia varten, koska aikuisille suunnatut sovellukset ovat usein liian monimutkaisia. Nuorimmatkin alakoululaiset k\\xe4ytt\\xe4v\\xe4t Lexie\\xe4 itsen\\xe4isesti ilman vanhempien apua.\\n\\nYmm\\xe4rr\\xe4mme, ett\\xe4 lapset tarvitsevat selkeytt\\xe4 ja suoraviivaisuutta. Siksi karsimme ylim\\xe4\\xe4r\\xe4iset valikot pois. K\\xe4yt\\xe4mme selkeit\\xe4 ohjeita ilman lapsellista kielt\\xe4 - sanat ovat tuttuja lapsille, mutta eiv\\xe4t aliarvioi heit\\xe4.\\n\\nKeskityimme vain tarpeellisiin toimintoihin, koska lasten on vaikea suodattaa liikaa tietoa kerralla. N\\xe4in lapsi voi keskitty\\xe4 oppimiseen eik\\xe4 joudu miettim\\xe4\\xe4n sovelluksen k\\xe4ytt\\xf6\\xe4.\\n\\nLukemisen avuksi tarjoamme isot alkukirjaimet tai vaihtoehtoisia fontteja. N\\xe4m\\xe4 helpottavat erityisesti aloittelevia lukijoita. Huomioimme lasten erilaiset lukutaidot ja oppimistyylit.\",\n        helpWithLanguageBarriers: \"Miten Lexie auttaa, jos suomi ei ole \\xe4idinkieli?\",\n        helpWithLanguageBarriersAnswer: \"Lexie auttaa perheit\\xe4, joissa vanhemmat eiv\\xe4t puhu samaa kielt\\xe4 kuin lapsi koulussa.\\n\\nSovelluksesta kuulet, miten sanat \\xe4\\xe4nnet\\xe4\\xe4n. K\\xe4\\xe4nn\\xf6stoiminto auttaa ymm\\xe4rt\\xe4m\\xe4\\xe4n sanoja eri kielill\\xe4.\\n\\nJos lapsi opiskelee suomea toisena kielen\\xe4, Lexie yhdist\\xe4\\xe4 uudet sanat tuttuihin k\\xe4sitteisiin h\\xe4nen omalla \\xe4idinkielell\\xe4\\xe4n.\\n\\nN\\xe4in vanhemmat voivat auttaa l\\xe4ksyiss\\xe4, vaikka eiv\\xe4t osaisi kielt\\xe4 hyvin.\",\n        // CTA\n        comeTest: \"Tule testaamaan\",\n        ctaDescription: \"Haemme perheit\\xe4 testaamaan Lexie\\xe4. Seuraa miten lapsesi k\\xe4ytt\\xe4\\xe4 sovellusta, ja anna palautetta mik\\xe4 toimii ja mik\\xe4 ei. Testaamalla autat meit\\xe4 rakentamaan Lexiest\\xe4 ty\\xf6kalun, joka oikeasti helpottaa perheiden arkea ja auttaa lapsiamme oppimaan paremmin.\",\n        scanDownload: \"Skannaa ja lataa LexieLearn\",\n        // Footer\n        privacy: \"Tietosuoja\",\n        terms: \"K\\xe4ytt\\xf6ehdot\",\n        // PageNav\n        termsOfService: \"K\\xe4ytt\\xf6ehdot\",\n        privacyPolicy: \"Tietosuoja\",\n        // Email form\n        insertEmail: \"S\\xe4hk\\xf6postiosoitteesi\",\n        getEarlyAccess: \"Liity testaajaksi\",\n        // Privacy Policy Page\n        privacyPage: {\n            title: \"LexieLearn Tietosuojaseloste\",\n            lastUpdated: \"P\\xc4IVITETTY: 01.04.2025\",\n            content: `\n1. Rekisterinpitäjä\nInterlinear Oy\nAlbertinkatu 26-28\nelina.patjas@interlinear.tech\nY-tunnus: 3523811-5\n\n2. Tärkeimmät periaatteet\n\n2.1 Ei henkilötietojen keräämistä lapsilta\n• Sovellukseen ei jää lapsesta mitään tietoja\n• Lapsen ei tarvitse rekisteröityä sovellukseen\n• Kaikki oppimissisältö tallentuu ainoastaan käyttäjän laitteelle\n\n2.2 Tietosuojaa koskevat periaatteet\n• Emme käytä kolmannen osapuolen sovelluksia tietojen keräämiseen\n• Kaikki kerätty tieto on täysin anonyymia\n• Sovelluksen ylläpidossa ei käytetä ulkopuolisia teknisiä kumppaneita\n\n3. Käsiteltävät tiedot\n\n3.1 Sovelluksen käyttöön liittyvät tiedot:\n• Laitteen käyttöjärjestelmä ja versio\n• Sovelluksen käyttötapa ja -versio\n• Anonyymit analytiikkatiedot sovelluksen toiminnasta\n\n3.2 Mitä tietoja ei kerätä:\n• Henkilötietoja (nimi, sähköposti, puhelinnumero)\n• Käyttäjän luomaa sisältöä tai oppimismateriaaleja\n• Sijaintitietoja\n• Käyttäjän laitteen yksilöiviä tunnistetietoja\n\n4. Tietojen käsittelyn tarkoitus ja oikeusperuste\n\n4.1 Käsittelyn tarkoitus:\n• Sovelluksen toiminnan kehittäminen\n• Käyttökokemuksen parantaminen\n• Teknisten ongelmien tunnistaminen ja korjaaminen\n• Käyttötilastojen analysointi\n\n4.2 Käsittelyn oikeusperuste:\n• Oikeutettu etu sovelluksen kehittämiseksi\n• Käyttäjän suostumus analytiikan keräämiseen\n\n5. Tietojen säilytys ja suojaus\n\n5.1 Tietojen säilytys:\n• Analytiikkatiedot säilytetään EU/ETA-alueella\n• Käyttäjän luoma sisältö säilyy vain käyttäjän omalla laitteella\n• Tietoja säilytetään vain niin kauan kuin on välttämätöntä\n\n5.2 Tietoturva:\n• Tietoliikenne on salattu\n• Pääsy tietoihin on rajattu vain välttämättömille henkilöille\n• Järjestelmien suojauksesta huolehditaan asianmukaisesti\n\n6. Tietojen luovutukset\n\n6.1 Tietoja ei luovuteta kolmansille osapuolille, paitsi:\n• Lain vaatiessa\n• Viranomaisten pyynnöstä\n\n6.2 Tekniset kumppanit:\n• Sovelluksen ylläpidossa ei käytetä ulkopuolisia teknisiä kumppaneita, jotka käsittelisivät käyttäjätietoja\n\n7. Käyttäjän oikeudet\n\n7.1 Koska sovellus kerää vain anonyymia tietoa, käyttäjällä on oikeus:\n• Saada tietoa sovelluksen tietojen käsittelystä\n• Vastustaa tietojen käsittelyä lopettamalla sovelluksen käyttö\n• Tehdä valitus valvontaviranomaiselle\n\n7.2 Oikeuksien käyttäminen:\n• Tietosuojaa koskevat kysymykset tulee osoittaa kirjallisesti kohdassa 1 mainittuun osoitteeseen\n• Vastaamme kysymyksiin kuukauden kuluessa\n\n8. Evästeet ja vastaavat teknologiat\n\n8.1 Sovellus ei käytä evästeitä.\n\n8.2 Analytiikkatietojen keräämiseen käytetään:\n• Sovelluksen sisäistä analytiikkajärjestelmää, joka kerää vain anonymisoituja käyttötietoja\n\n9. Tietosuojaselosteen muutokset\n\n9.1 Pidämme oikeuden muuttaa tätä tietosuojaselostetta.\n\n9.2 Muutoksista ilmoitetaan:\n• Sovelluksessa\n• Verkkosivuillamme`\n        },\n        // Terms Page\n        termsPage: {\n            title: \"LexieLearn K\\xe4ytt\\xf6ehdot\",\n            lastUpdated: \"P\\xc4IVITETTY: 01.04.2025\",\n            content: `\n1. Yleistä\n\n1.1 LexieLearn (\"Sovellus\") on Interlinear Oy:n (\"Palveluntarjoaja\") tarjoama oppimistyökalu, joka muuntaa tekstiä oppimismateriaaliksi.\n\n1.2 Nämä käyttöehdot määrittelevät Sovelluksen käyttöön liittyvät ehdot käyttäjän (\"Käyttäjä\") ja Palveluntarjoajan välillä.\n\n1.3 Käyttämällä Sovellusta Käyttäjä hyväksyy nämä käyttöehdot ja sitoutuu noudattamaan niitä.\n\n2. Käyttöoikeus\n\n2.1 Palveluntarjoaja myöntää Käyttäjälle rajoitetun, henkilökohtaisen, ei-siirrettävän oikeuden käyttää Sovellusta näiden käyttöehtojen mukaisesti.\n\n2.2 Käyttöoikeus on voimassa toistaiseksi ja Palveluntarjoaja voi peruuttaa sen, jos Käyttäjä rikkoo näitä käyttöehtoja.\n\n3. Sovelluksen käyttö\n\n3.1 Sovellus on tarkoitettu vain henkilökohtaiseen oppimiskäyttöön.\n\n3.2 Sovelluksen käyttö edellyttää:\n• Mobiililaitetta ja internet-yhteyttä\n• Kameran käyttöoikeutta\n• Laitteen tallennustilan käyttöoikeutta\n\n4. Käyttäjän sisältö ja oikeudet\n\n4.1 Lataamalla tai lähettämällä mitä tahansa sisältöä LexieLearniin käsiteltäväksi (\"Käyttäjän Sisältö\"), vahvistat että:\n• Omistat sisällön, TAI\n• Sinulla on tekijänoikeuden omistajan lupa käyttää sisältöä, TAI\n• Käyttösi on oikeutettua opetuskäyttöä tai \"fair use\" -käyttöä sovellettavan lain mukaisesti, TAI\n• Sisältö on vapaassa käytössä tai avoimen lisenssin alla, joka sallii tällaisen käytön.\n\n4.2 Opetuksellinen tarkoitus\n\nSitoudut käyttämään LexieLearnia vain henkilökohtaisiin oppimistarkoituksiin tai perheenjäsentesi tai suorassa ohjauksessasi olevien oppilaiden opetukselliseksi hyödyksi.\n\n4.3 Kielletyt käyttötavat\n\nEt saa käyttää LexieLearnia:\n• Tekijänoikeudella suojattujen materiaalien käsittelyyn ilman asianmukaisia oikeuksia tai oikeutettua opetuksellista perustetta\n• Johdannaisteosten luomiseen kaupallisiin tarkoituksiin\n• Käsiteltyjen materiaalien jakamiseen tai levittämiseen henkilökohtaisen opetuskäytön ulkopuolelle\n• Materiaalien käsittelyyn tavalla, joka voisi vahingoittaa tekijänoikeuden haltijan markkinoita teokselleen\n\n5. Käyttäjän vastuu\n\n5.1 Käyttäjä on yksin vastuussa:\n• Sovelluksella käsittelemästään sisällöstä\n• Tekijänoikeuslakien ja muiden sovellettavien lakien noudattamisesta\n• Laitteensa ja internet-yhteytensä toimivuudesta\n\n5.2 Käyttäjä sitoutuu olemaan:\n• Jakamatta Sovelluksen tuottamaa sisältöä\n• Käyttämättä Sovellusta kaupallisiin tarkoituksiin\n• Yrittämättä kiertää Sovelluksen teknisiä rajoituksia\n\n6. LexieLearnin rooli ja rajoitukset\n\n6.1 Käsittelypalvelu\n\nLexieLearn tarjoaa työkalun, joka käsittelee Käyttäjän Sisältöä luodakseen opetuksellisia materiaaleja kuten tietovisoja, muistikortteja ja äänitiedostoja. Kaikki käsittely tapahtuu paikallisesti käyttäjän laitteella.\n\n6.2 Ei tallennusta tai pääsyä\n\nLexieLearn ei tallenna, käytä tai jaa edelleen Käyttäjän Sisältöä. Kaikki materiaalit säilyvät ainoastaan käyttäjän laitteella ja käyttäjän hallinnassa.\n\n6.3 Ei tarkistusta tai valvontaa\n\nLexieLearn ei tarkista tai valvo Käyttäjän Sisältöä tekijänoikeuksien noudattamisen osalta. Vastuu asianmukaisten oikeuksien varmistamisesta on kokonaan käyttäjällä.\n\n7. Sisällön käsittely ja yksityisyys\n\n7.1 Kaikki Sovelluksella käsitelty sisältö:\n• Tallennetaan vain Käyttäjän omalle laitteelle\n• Ei siirry Palveluntarjoajan palvelimille\n• On vain Käyttäjän käytettävissä\n\n7.2 Palveluntarjoaja kerää vain Sovelluksen toiminnan kannalta välttämättömiä analytiikkatietoja.\n\n8. Immateriaalioikeudet\n\n8.1 Kaikki Sovellukseen liittyvät immateriaalioikeudet kuuluvat Palveluntarjoajalle.\n\n8.2 Käyttäjä säilyttää kaikki oikeudet sähköisessä muodossa olevaan sisältöönsä.\n\n9. Oikeudellinen vastuu\n\n9.1 Vastuuvapautuslauseke\n\nSitoudut puolustamaan, vapauttamaan vastuusta ja pitämään LexieLearnin, sen emoyhtiön, tytäryhtiöt, toimihenkilöt ja työntekijät vahingoittumattomina kaikista vaatimuksista, vahingoista, vastuista, kustannuksista tai kuluista (mukaan lukien kohtuulliset asianajajan palkkiot), jotka johtuvat näiden ehtojen rikkomisestasi tai Palvelun käytöstäsi.\n\n9.2 Oikeudelliset seuraamukset\n\nTiedostat, että tekijänoikeudella suojattujen materiaalien luvaton käyttö saattaa altistaa sinut oikeudelliselle vastuulle, mukaan lukien mahdolliset tekijänoikeuden haltijoiden tekijänoikeusrikkomusvaatimukset.\n\n10. Vastuunrajoitukset\n\n10.1 Sovellus tarjotaan \"sellaisena kuin se on\".\n\n10.2 Palveluntarjoaja ei vastaa:\n• Sovelluksen keskeytymättömästä toiminnasta\n• Sovelluksen virheettömyydestä\n• Käyttäjän sisällön säilymisestä\n• Välillisistä tai välittömistä vahingoista\n\n11. Tekijänoikeusvalitukset ja täytäntöönpano\n\n11.1 Alasottomenettely\n\nTekijänoikeuden haltijat, jotka uskovat oikeuksiaan loukatun, voivat lähettää ilmoituksen osoitteeseen [copyright@lexielearn.com]. Tutkimme viipymättä oikeutetut valitukset.\n\n11.2 Irtisanomisoikeus\n\nLexieLearn pidättää oikeuden lopettaa palvelun käyttäjiltä, jotka toistuvasti rikkovat näitä ehtoja tai ovat useiden oikeutettujen tekijänoikeusvalitusten kohteena.\n\n11.3 Yhteistyö viranomaisten kanssa\n\nLexieLearn tekee yhteistyötä viranomaisten kanssa väitetyn laittoman toiminnan tutkimuksissa.\n\n12. Opetukselliset ohjeet\n\n12.1 Parhaat käytännöt\n\nKannustamme käyttäjiä:\n• Käyttämään vapaassa käytössä olevia tai avoimesti lisensoituja opetusmateriaaleja kun mahdollista\n• Rajoittamaan tekijänoikeudella suojattujen teosten käsittelyä pieniin osiin kun fair use -periaate soveltuu\n• Harkitsemaan digitaalisten oikeuksien ostamista kun säännöllisesti käyttää kaupallista sisältöä\n• Tarkistamaan oppilaitoksilta opiskelijoille saatavilla olevat lisensoidut materiaalit\n\n13. Muutokset\n\n13.1 Palveluntarjoaja pidättää oikeuden:\n• Muuttaa näitä käyttöehtoja\n• Muuttaa Sovelluksen ominaisuuksia\n• Lopettaa Sovelluksen tarjoamisen\n\n13.2 Muutoksista ilmoitetaan Sovelluksessa tai Palveluntarjoajan verkkosivuilla.\n\n14. Sovellettava laki ja riitojen ratkaisu\n\n14.1 Näihin käyttöehtoihin sovelletaan Suomen lakia.\n\n14.2 Mahdolliset riidat pyritään ensisijaisesti ratkaisemaan neuvotteluteitse.\n\n15. Yhteystiedot\n\n15.1 Kysymykset ja yhteystiedot:\n• Interlinear Oy\n• Albertinkatu 26-28\n• elina.patjas@interlinear.tech\n• Y-tunnus: 3523811-5`\n        },\n        // Common sections for both pages\n        contactInfo: {\n            companyName: \"Interlinear OY\",\n            address: \"Albertinkatu 26-28\",\n            email: \"elina.patjas@interlinear.tech\",\n            businessId: \"3523811-5\"\n        },\n        // Form success message\n        formSubmitSuccess: \"Kiitos! S\\xe4hk\\xf6postisi on l\\xe4hetetty tiimillemme.\",\n        formSubmitError: \"S\\xe4hk\\xf6postin l\\xe4hett\\xe4misess\\xe4 tapahtui virhe. Ole hyv\\xe4 ja yrit\\xe4 uudelleen.\",\n        formInvalidEmail: \"Anna kelvollinen s\\xe4hk\\xf6postiosoite\"\n    },\n    en: {\n        // Header\n        tryForFree: \"Try for free\",\n        // Hero\n        betterWayToLearn: \"Making homework help actually helpful.\",\n        heroDescription: \"Lexie turns any printed material into interactive tools that give students immediate feedback when practicing alone. Snap a photo, get digital practice material that works.\",\n        tryFreeButton: \"Try for free\",\n        // Features\n        takePicture: \"Take a photo. Lexie handles the rest.\",\n        featuresIngress: \"Turn any printed material into digital study content with a quick snapshot.\",\n        adaptiveText: \"Homework help that builds real understanding\",\n        adaptiveTextDesc: \"Snap a photo of a homework question and get guidance right away. Lexie helps you discover answers instead of just giving solutions.\",\n        effectiveWay: \"Learn in manageable chunks that stick.\",\n        effectiveWayDesc: \"Flashcards break down complex topics into pieces you'll actually remember.\",\n        testYourKnowledge: \"Practice that shows what you've mastered.\",\n        testYourKnowledgeDesc: \"Know exactly what you understand instead of guessing if you're right.\",\n        // Benefits\n        supportingEveryChild: \"Tools that work for your learning.\",\n        personalLearningSupport: \"A tutor that's always available\",\n        personalLearningDesc: \"When you don't have someone to help, Lexie explains concepts clearly and guides you step by step.\",\n        enhanceLearning: \"Immediate feedback builds confidence\",\n        enhanceLearningDesc: \"See what you've mastered and what needs more work, without waiting for test results.\",\n        learnAnywhere: \"Access your materials anywhere\",\n        learnAnywhereDesc: \"Capture study content once and access it anytime, even when original materials aren't with you.\",\n        learnInYourLanguage: \"Study in your preferred language\",\n        learnInYourLanguageDesc: \"Translate terms and explanations to your language when learning in a language you're not fluent in.\",\n        buildConfidence: \"Build independent study skills\",\n        buildConfidenceDesc: \"Figure things out yourself instead of waiting for help that might not come. Practice when you need to, how you need to.\",\n        adaptiveLearning: \"Adapts to how you learn best\",\n        adaptiveLearningDesc: \"Customize text or listen to content read aloud. Use what works for you.\",\n        // FAQ\n        faq: \"Frequently asked questions\",\n        howLexieWorks: \"How does Lexie actually work?\",\n        howLexieWorksAnswer: \"Lexie uses image recognition to read your study materials. When you take a photo, our technology identifies the text, analyzes the content structure, and determines what kind of learning material it is.\\n\\nThe system then breaks down the content into key concepts and relationships. For vocabulary, it identifies terms and definitions. For history, it recognizes events and dates. For science, it extracts concepts and explanations.\\n\\nThis processed information gets transformed into different practice formats:\\n\\n• Quizzes that test understanding at multiple levels\\n• Flashcards for quick recall practice\\n• Audio for correct pronunciation\\n• Summaries that highlight main points\\n\\nThe entire process takes seconds. You don't need to type anything or format the content yourself.\",\n        whatCanLearn: \"What subjects work best with Lexie?\",\n        whatCanLearnAnswer: \"Lexie works well with language arts, social studies, science, and foreign languages. Any subject that involves text-based learning materials.\\n\\nLexie doesn't handle math equations well yet. While it can process math vocabulary terms, it struggles with complex formulas and calculations. We're working on improving this.\\n\\nSimilarly, highly visual subjects like art or music theory with complex notations might not process correctly. Text-heavy materials with clear structure work best.\",\n        whyDifferent: \"How is Lexie different from other learning apps?\",\n        whyDifferentAnswer: \"Unlike most learning apps that provide pre-made content, Lexie works with your actual school materials - the worksheets, textbooks, and handouts your child needs to learn right now.\\n\\nYou don't need to manually enter content or be limited to certain subjects - just photograph any material and Lexie automatically extracts the key information.\\n\\nWhile flashcard apps require you to type every term and definition, Lexie extracts this information automatically.\\n\\nInstead of replacing homework, Lexie makes your existing homework more effective by turning it into interactive practice tools.\",\n        howToUse: \"What learning methods does Lexie use?\",\n        howToUseAnswer: \"Lexie uses principles from evidence-based learning science:\\n\\n• Active recall - pushing students to retrieve information rather than just re-read it\\n• Spaced repetition - reviewing material at strategic intervals for better retention\\n• Comprehension monitoring - helping students identify what they do and don't understand\\n• Multimodal learning - engaging with content in different formats (text, audio, interactive quizzes)\\n\\nThe app follows a Socratic approach by asking questions that guide understanding rather than simply providing answers. This builds critical thinking skills alongside subject knowledge.\",\n        materialsStored: \"Is my data secure in Lexie?\",\n        materialsStoredAnswer: \"Yes. We don't store the original photos you take beyond the processing stage. The learning materials created are stored only on your device and in your personal account.\\n\\nWe don't share your content with other users or third parties. We don't use your materials to train our systems. Your child's study data stays private.\\n\\nThe app requires camera access only to capture study materials. We don't access other photos on your device.\",\n        howDesignedForKids: \"How is Lexie designed for kids?\",\n        howDesignedForKidsAnswer: \"We designed Lexie specifically for children, because apps made for adults are often too complicated. Even the youngest primary schoolers use Lexie independently without parents' help.\\n\\nWe understand that children need clarity and straightforwardness. That's why we removed extra menus. We use clear instructions without childish language - the words are familiar to children but don't underestimate them.\\n\\nWe focused only on necessary functions, because children find it difficult to filter too much information at once. This way the child can focus on learning instead of having to think about how to use the app.\\n\\nFor reading assistance, we offer capital letters or alternative fonts. These especially help beginning readers. We consider children's different reading skills and learning styles.\",\n        helpWithLanguageBarriers: \"How does Lexie help with language barriers?\",\n        helpWithLanguageBarriersAnswer: \"Lexie bridges language gaps for families where parents don't speak the language their child is learning in school.\\n\\nThe app provides audio pronunciation for terms so parents don't need to know how words should sound. Translation features help connect concepts between languages.\\n\\nFor ELL students, Lexie creates vocabulary supports that link new terms to concepts they already understand in their primary language.\\n\\nThis allows parents to support learning even when they face language barriers themselves.\",\n        // CTA\n        comeTest: \"Join the free beta\",\n        ctaDescription: \"We're looking for families to test Lexie. Watch your child using it and tell us what works and what doesn't. Your feedback will guide us make Lexie better for real-world learning. Help us build a tool that actually makes homework time easier.\",\n        scanDownload: \"Scan to download LexieLearn\",\n        // Footer\n        privacy: \"Privacy\",\n        terms: \"Terms\",\n        // PageNav\n        termsOfService: \"Terms of Service\",\n        privacyPolicy: \"Privacy Policy\",\n        // Email form\n        insertEmail: \"Enter your email\",\n        getEarlyAccess: \"Get early access\",\n        // Privacy Policy Page\n        privacyPage: {\n            title: \"LexieLearn Privacy Policy\",\n            lastUpdated: \"UPDATED: April 1, 2025\",\n            content: `\n1. Data Controller\nInterlinear Oy\nAlbertinkatu 26-28\nelina.patjas@interlinear.tech\nBusiness ID: 3523811-5\n\n2. Key Principles\n\n2.1 No Personal Data Collection from Children\n• No information about children is stored in the application\n• Children do not need to register to use the application\n• All learning content is stored only on the user's device\n\n2.2 Privacy Principles\n• We do not use third-party applications for data collection\n• All collected data is completely anonymous\n• No external technical partners are used in maintaining the application\n\n3. Processed Data\n\n3.1 Information Related to Application Usage:\n• Device operating system and version\n• Application usage method and version\n• Anonymous analytics data about application functioning\n\n3.2 What Data Is Not Collected:\n• Personal information (name, email, phone number)\n• User-created content or learning materials\n• Location data\n• Unique device identifiers\n\n4. Purpose and Legal Basis for Data Processing\n\n4.1 Purpose of Processing:\n• Developing application functionality\n• Improving user experience\n• Identifying and fixing technical issues\n• Analyzing usage statistics\n\n4.2 Legal Basis for Processing:\n• Legitimate interest in developing the application\n• User consent for analytics collection\n\n5. Data Storage and Protection\n\n5.1 Data Storage:\n• Analytics data is stored within the EU/EEA area\n• User-created content remains only on the user's own device\n• Data is retained only as long as necessary\n\n5.2 Data Security:\n• Data traffic is encrypted\n• Access to data is limited to essential personnel only\n• Systems are properly protected\n\n6. Data Transfers\n\n6.1 Data is not disclosed to third parties, except:\n• When required by law\n• At the request of authorities\n\n6.2 Technical Partners:\n• No external technical partners are used in maintaining the application that would process user data\n\n7. User Rights\n\n7.1 Since the application collects only anonymous data, the user has the right to:\n• Receive information about the application's data processing\n• Object to data processing by ceasing to use the application\n• Lodge a complaint with a supervisory authority\n\n7.2 Exercising Rights:\n• Privacy-related inquiries should be addressed in writing to the address mentioned in section 1\n• We will respond to inquiries within one month\n\n8. Cookies and Similar Technologies\n\n8.1 The application does not use cookies.\n\n8.2 For collecting analytics data, we use:\n• The application's internal analytics system, which collects only anonymized usage data\n\n9. Changes to the Privacy Policy\n\n9.1 We reserve the right to modify this privacy policy.\n\n9.2 Changes will be announced:\n• In the application\n• On our website\n\n10. Contact Information\n\nFor privacy-related questions:\n  \nElina Patjas  \nelina.patjas@interlinear.tech  \n+35850 408 6722  \nInterlinear Oy  \nAlbertinkatu 26-28  \nBusiness ID: 3523811-5`\n        },\n        // Terms Page\n        termsPage: {\n            title: \"LexieLearn Terms and Conditions\",\n            lastUpdated: \"UPDATED: April 1, 2025\",\n            content: `\n1. General\n\n1.1 LexieLearn (\"Application\") is a learning tool provided by Interlinear Oy (\"Service Provider\") that converts text into learning materials.\n\n1.2 These terms define the conditions related to the use of the Application between the user (\"User\") and the Service Provider.\n\n1.3 By using the Application, the User accepts these terms and agrees to comply with them.\n\n2. Right of Use\n\n2.1 The Service Provider grants the User a limited, personal, non-transferable right to use the Application according to these terms.\n\n2.2 The right of use is valid until further notice, and the Service Provider may revoke it if the User violates these terms.\n\n3. Application Use\n\n3.1 The Application is intended for personal learning use only.\n\n3.2 Using the Application requires:\n• A mobile device and internet connection\n• Camera access permissions\n• Device storage access permissions\n\n4. User Content and Rights\n\n4.1 By uploading or submitting any content to LexieLearn for processing (\"User Content\"), you confirm that:\n• You own the content, OR\n• You have permission from the copyright owner to use the content, OR\n• Your use qualifies as legitimate educational use or \"fair use\" under applicable law, OR\n• The content is in the public domain or under an open license permitting such use.\n\n4.2 Educational Purpose\n\nYou agree to use LexieLearn only for personal educational purposes or for the educational benefit of your immediate family members or students under your direct supervision.\n\n4.3 Prohibited Uses\n\nYou may not use LexieLearn to:\n• Process copyrighted materials without appropriate rights or legitimate educational justification\n• Create derivative works for commercial purposes\n• Share or distribute processed materials beyond personal educational use\n• Process materials in a manner that could harm a copyright holder's market for their work\n\n5. User Responsibility\n\n5.1 The User is solely responsible for:\n• Content processed with the Application\n• Compliance with copyright laws and other applicable laws\n• The functionality of their device and internet connection\n\n5.2 The User agrees not to:\n• Share content produced by the Application\n• Use the Application for commercial purposes\n• Attempt to bypass the Application's technical limitations\n\n6. LexieLearn's Role and Limitations\n\n6.1 Processing Service\n\nLexieLearn provides a tool that processes User Content to create educational assets such as quizzes, flashcards, and audio. All processing occurs locally on your device.\n\n6.2 No Storage or Access\n\nLexieLearn does not store, access, or redistribute your User Content. All materials remain solely on your device and under your control.\n\n6.3 No Review or Monitoring\n\nLexieLearn does not and cannot review or monitor User Content for copyright compliance. The responsibility for ensuring proper rights remains entirely with you.\n\n7. Content Processing and Privacy\n\n7.1 All content processed with the Application:\n• Is stored only on the User's own device\n• Is not transferred to the Service Provider's servers\n• Is available only to the User\n\n7.2 The Service Provider collects only analytics data that is essential for the operation of the Application.\n\n8. Intellectual Property Rights\n\n8.1 All intellectual property rights related to the Application belong to the Service Provider.\n\n8.2 The User retains all rights to their content in electronic form.\n\n9. Your Legal Responsibility\n\n9.1 Indemnification\n\nYou agree to defend, indemnify, and hold harmless LexieLearn, its parent company, affiliates, officers, and employees from any claims, damages, liabilities, costs, or expenses (including reasonable attorneys' fees) arising from your violation of these terms or your use of the Service.\n\n9.2 Legal Consequences\n\nYou acknowledge that unauthorized use of copyrighted materials may subject you to legal liability, including potential copyright infringement claims from rights holders.\n\n10. Limitation of Liability\n\n10.1 The Application is provided \"as is.\"\n\n10.2 The Service Provider is not responsible for:\n• Uninterrupted operation of the Application\n• Error-free operation of the Application\n• Preservation of the User's content\n• Indirect or direct damages\n\n11. Copyright Complaints and Enforcement\n\n11.1 Takedown Procedure\n\nCopyright holders who believe their rights have been violated may submit a notice to [copyright@lexielearn.com]. We will promptly investigate legitimate complaints.\n\n11.2 Termination Rights\n\nLexieLearn reserves the right to terminate service for users who repeatedly violate these terms or are the subject of multiple legitimate copyright complaints.\n\n11.3 Cooperation with Legal Authorities\n\nLexieLearn will cooperate with legal authorities in investigations of alleged illegal activity.\n\n12. Educational Guidelines\n\n12.1 Best Practices\n\nWe encourage users to:\n• Use public domain or openly licensed educational materials when possible\n• Limit processing to small portions of copyrighted works when fair use applies\n• Consider purchasing digital rights when regularly using commercial content\n• Check with educational institutions about licensed materials available to students\n\n13. Changes\n\n13.1 The Service Provider reserves the right to:\n• Change these terms\n• Change the features of the Application\n• Discontinue offering the Application\n\n13.2 Changes will be announced in the Application or on the Service Provider's website.\n\n14. Applicable Law and Dispute Resolution\n\n14.1 Finnish law applies to these terms.\n\n14.2 Any disputes will primarily be resolved through negotiations.\n\n15. Contact Information\n\n15.1 Questions and contact details:\n• Interlinear Oy\n• Albertinkatu 26-28\n• elina.patjas@interlinear.tech\n• Business ID: 3523811-5`\n        },\n        // Common sections for both pages\n        contactInfo: {\n            companyName: \"Interlinear OY\",\n            address: \"Albertinkatu 26-28\",\n            email: \"elina.patjas@interlinear.tech\",\n            businessId: \"3523811-5\"\n        },\n        // Form success message\n        formSubmitSuccess: \"Thank you! Your email has been sent to our team.\",\n        formSubmitError: \"There was an error submitting your email. Please try again.\",\n        formInvalidEmail: \"Please enter a valid email address\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/translations.ts\n");

